import React from 'react'
import { Link } from 'react-router-dom';
import * as rb from "react-bootstrap";
import Dbms from './DBMS/Dbms';

const colStyle = {
    margin: "3em",
    diplay: "flex",
}

class Sem4 extends React.Component {
    render() {
        return (
            <rb.Container >
                <rb.Row>
                    <rb.Col style={colStyle}>
                        <Link to={Dbms}>
                            <rb.Button variant="outline-primary">
                                Database Management System [DBMS]
                            </rb.Button>
                        </Link>

                    </rb.Col >
                    <rb.Col style={colStyle}>
                        {/* <Link to={`/cse/1`}> */}
                        <rb.Button variant="outline-primary">
                            JAVA
                        </rb.Button>
                        {/* </Link> */}
                    </rb.Col>
                    <rb.Col style={colStyle}>
                        {/* <Link to={`/cse/1`}> */}
                        <rb.Button variant="outline-primary">
                            Data Structure  And Algorithms [DAA]
                        </rb.Button>
                        {/* </Link> */}
                    </rb.Col>
                </rb.Row>
                <rb.Row>
                    <rb.Col style={colStyle}>
                        {/* <Link to={`/cse/1`}> */}
                        <rb.Button variant="outline-primary">
                            Operating System [OS]
                        </rb.Button>
                        {/* </Link> */}
                    </rb.Col>
                    <rb.Col style={colStyle}>
                        {/* <Link to={`/cse/1`}> */}
                        <rb.Button variant="outline-primary">
                            ENGINEERING MATHEMATICS-IV [MATH4]
                        </rb.Button>
                        {/* </Link> */}
                    </rb.Col>
                </rb.Row>
            </rb.Container>
        );
    }
}

export default Sem4;
